import React, { useEffect } from 'react';

const AIChatbot = () => {
  useEffect(() => {
    document.title = "Chatbot - AI Chatbot"; // Set the page title
  }, []);
  return (
    <div>
      <h1>Chat with Us</h1>
    </div>
  );
};


export default AIChatbot;
